function updateAllDict() {
  for (var dict in dicts) {
    if (!dicts[dict].combined) {
      continue;
    }

    dicts[dict].words = [];

    var used = {};
    for (var i = 0; i < dicts[dict].combined.length; i++) {
      var dep = dicts[dict].combined[i];
      for (var j = 0; j < dicts[dep].words.length; j++) {
        var word = dicts[dep].words[j].toLocaleLowerCase().replace(/ё/g, 'е');
        if (!used[word]) {
          used[word] = true;
          dicts[dict].words.push(dicts[dep].words[j]);
        }
      }
    }

    dicts[dict].words.sort(function(word1, word2) {
      word1 = word1.toLocaleLowerCase();
      word2 = word2.toLocaleLowerCase()
      if (word1[0] == 'ё' && word2[0] != 'ё') {
        return word2[0] <= 'е' ? 1 : -1;
      }
      if (word2[0] == 'ё' && word1[0] != 'ё') {
        return word1[0] <= 'е' ? -1 : 1;
      }
      word1 = word1.replace(/&shy;/g, '').replace(/­/g, '').replace(/ё/g, 'е');
      word2 = word2.replace(/&shy;/g, '').replace(/­/g, '').replace(/ё/g, 'е');
      if (word1 == word2) {
        return 0;
      }
      if (word1 < word2) {
        return -1;
      } else {
        return 1;
      }
    });

    if (dicts[dict].locale == 'ru') {
      if (document.getElementById('dict-' + dict)) {
        document.getElementById('dict-' + dict).innerText = dicts[dict].title.replace(/%/,
          dicts[dict].words.length + ' ' + num(dicts[dict].words.length, ['слово', 'слова', 'слов'])
        );
      }
    } else {
      document.getElementById('dict-' + dict).innerText = dicts[dict].title.replace(/%/,
        dicts[dict].words.length + ' ' + (dicts[dict].words.length > 1 ? 'words' : 'word')
      );
    }
  }
  updatePlayers();
}

