function generateGoodCode() {
  var tries = 0;
  var best = false;
  while (true) {
    var code = generateCode(true);
    var game = gameFromCode(code, words);
    tries++;

    var penalty = 0;
    var veryBad = false;

    for (var i = 0; i < game.words.length; i++) {
      if (game.words[i] in badWords) {
        penalty += Math.pow(2, badWords[game.words[i]]);
        if (badWords[game.words[i]] >= 4) {
          veryBad = true;
        }
      }
    }

    if (veryBad) {
      continue;
    }

    if (!best || best.penalty > penalty) {
      best = {
        game: game,
        code: code,
        penalty: penalty
      }
    }

    if (tries >= 20 && best) {
      break;
    }
  }

  document.getElementById('code').value = best.code;
  document.location.hash = isSafari ? encodeURIComponent(best.code) : best.code;
  return best.code;
}

function generateCode_old(locale) {
  var bigrams = locale == 'ru' ? bigrams_ru : bigrams_en;
  var vowels = locale == 'ru' ? vowels_ru : vowels_en;
  var fin = locale == 'ru' ? 'ЙЫЬ' : '';

  var len = 4 + Math.floor(Math.random() * 3);
  var code = bigrams['^'][Math.floor(Math.random() * bigrams['^'].length)];
  var prev = code;
  var prevVowel = vowels.indexOf(prev) > -1;
  var run = 1;
  for (var i = 0; i < len; i++) {
    var next, nextVowel, done;
    do {
      next = bigrams[prev][Math.floor(Math.random() * bigrams[prev].length)];
      nextVowel = vowels.indexOf(next) > -1;
      done = (i >= 3) || (fin.indexOf(next) == -1);
      if (prevVowel == nextVowel) {
        // 4 гласных или согласных подряд: запретить совсем
        if (run >= 3) {
          done = false;
        } else
        // 2 одинаковых гласных + гласная, 2 одинаковых согласных + согласная
        if ((run >= 2) && (prev == code[code.length - 2])) {
          done = false;
        } else
        // 3 гласных подряд
        if ((run >= 2) && prevVowel) {
          done = false;
        } else
        // 3 согласных подряд: запретить в 66% случаев
        if ((run >= 2) && (Math.random() > 0.333)) {
          done = false;
        }
      }
    } while (!done);
    code += next;
    prev = next;
    if (prevVowel == nextVowel) {
      run++;
    } else {
      prevVowel = nextVowel;
      run = 1;
    }
    if (fin.indexOf(next) > -1) {
      break;
    }
  }

  /*if (!noUpdates) {
    document.getElementById('code').value = code;
    document.location.hash = isSafari ? encodeURIComponent(code) : code;
  }*/
  return code;
}

