function settingsFromCode(code) {
  var seed = [0xdeadbeef];
  var dict = dictKeys;
  if (code.match(/[A-Za-z]/) && !code.match(/[а-яА-ЯёЁ]/)) {
    dict = dictKeysEn;
  } else
  if (!code.match(/[A-Za-z]/) && code.match(/[а-яА-ЯёЁ]/)) {
    dict = dictKeysRu;
  }
  for (var i = 0; i < code.length; i++) {
    seed.push(code.charCodeAt(i));
  }
  var rnd = new MersenneTwister(seed);
  var sizes = [[5, 6, 9], [5, 5, 8], [5, 4, 7]];
  return {
    size: sizes[~~(rnd.random() * sizes.length)],
    dict: dict[~~(rnd.random() * dict.length)]
  }
}

function updatePlayers() {
  var code = document.getElementById('code').value.trim().toLocaleUpperCase();
  if (socketsActive) {
    sockets.emit('key', code);
  }
  var seed = [0xffffff];
  // Seed Mersenne Twister with current day + code
  //seed.push(Math.floor((new Date()).getTime() / 86400000));
  for (var i = 0; i < code.length; i++) {
    seed.push(code.charCodeAt(i));
  }
  var rnd = new MersenneTwister(seed);
  //console.log('Seed: ', seed);

  if (window.localStorage) {
    window.localStorage['players'] = document.getElementById('players').value;
  }

  var players = document.getElementById('players').value.trim().split('\n');
  if (players.length > 1) {
    for (var i = players.length - 1; i > 0; i--) {
      var j = ~~(rnd.random() * (i + 1));
      var tmp = players[i];
      players[i] = players[j];
      players[j] = tmp;
    }

    var redTeam, blueTeam;
    if (players.length < 4) {
      redTeam = players;
      blueTeam = ['–', '(все против игры)'];
    } else
    if (rnd.random() < 0.5) {
      redTeam = players.slice(0, ~~(players.length / 2));
      blueTeam = players.slice(~~(players.length / 2));
    } else {
      redTeam = players.slice(~~(players.length / 2));
      blueTeam = players.slice(0, ~~(players.length / 2));
    }

    $('.team-red').html(redTeam.map(function(name, i) {
      return '<div class="player">' + (i == 0 ? 'Капитан: ' : '') + '<span class="name">' + name + '</span></div>';
    }).join(''));

    if (players.length < 4) {
      $('.team-blue').html('<div class="nobody">все против игры</div>');
    } else {
      $('.team-blue').html(blueTeam.map(function(name, i) {
        return '<div class="player">' + (i == 0 ? 'Капитан: ' : '') + '<span class="name">' + name + '</span></div>';
      }).join(''));
    }
  } else {
    $('.team-red').html('');
    $('.team-blue').html('');
  }
  $('#teams').toggle($('.team-red').html().length > 0);

  var settings = settingsFromCode(code);
  if (settings.dict in dicts) {
    selectDict(settings.dict, true);
    selectSize(settings.size[0], settings.size[1], settings.size[2], true);
  }
}

