var sockets = false;
var socketsActive = false;
if (window.io) {
  sockets = io.connect('/');
  sockets.on('connect', function() {
    socketsActive = true;
    sockets.emit('key', currentCode);
  });
  sockets.on('message', function(message) {
    if (message.key == currentCode) {
      if (message.action == 'word') {
        console.log(message);
        chooseWord(message.word, message.red, message.blue);
      } else
      if (message.action == 'join') {
        console.log('someone joined, sending state: ', {
          guessed: guessed,
          red: countRed,
          blue: countBlue
        });
        sockets.emit('message', {
          key: currentCode,
          action: 'state',
          guessed: guessed,
          red: countRed,
          blue: countBlue
        });
      } else
      if (message.action == 'state') {
        console.log('received a state, merging ', {
          guessed: message.guessed,
          red: message.red,
          blue: message.blue
        }, ' with ', {
          guessed: guessed,
          red: countRed,
          blue: countBlue
        });
        for (var w in message.guessed) {
          guessed[w] = true;
        }
        showPlayground(currentMode, true, Math.min(countRed, message.red), Math.min(countBlue, message.blue));
      }
    }
  });
  sockets.on('disconnect', function() {
    socketsActive = false;
  });
}
